{"description":"He is truly dedicated to Abstract. He's a member of the Abstract community who is really hungry, he's constantly digging on the chain looking for opportunities, and they spread the good word everywhere he can.

He's really a member of the community that every community would love to have.

His devotion has been rewarded, knowing that today he is a Gigachad, and in my opinion, it is well deserved."}

{"description":"He introduced me to the Oekaki ecosystem, and I can't thank him enough for that.

Being a big fan of Japanese culture, I really fell in love with the latest collection they're releasing.

Apart from that, PandyBear is a very active person on the Abstract discord, committed to making the community a better place, and not afraid to say things frankly, which is exactly what I like about him. He's not afraid of hurting people's feelings, he says what he thinks."}

{
  "description": "I really love the vibe and positive energy he bring to Abstract community , he is also a real OG in Pudgy culture

Btw, his streaming is full of high quality and lot of deeply insight about Abstract was posted in his X

Happy to be in Abstract Journey with you friend! Respect everything best you did"
}

{
  "description": "Known this goat since I joined the space, his street art is absolutely amazing and is probably one of the coolest initiatives I've seen in this space from art perspective

Super supportive and kind too

Nothing but the best to say about Pavil"
}

{
  "description": "Vitlus has been supporting and growing not only Ruyui but also Abstract since the very beginning: he’s an active member of the community, always aware of what’s going on, always ready to help, always moving the conversation forward.\nHe makes a real contribution, shares ideas, supports people, and helps projects grow. He respects the community and keeps his word.\nA true GigaChad and one of those people who make our ecosystem better every single day."
}

{
  "description": "When people talk to me about Loko, I think of the Ozy NFT collection. Loko is an abstract OG, he works and helps differents projects with his designer talents. In addition to being talented, Loko is extremely kind. Very happy to be by his side as a giga."
}

{
  "description": "Guezit0 is the giga chad who bring me to ethos, i'm highly appreciate it 

He is a really enthusiastic person, he almost always warms up the giga chad team at abstract about Ethos

The energy, vibes he spreads to the community is something that is very hard to find elsewhere. 

Thank you for all you do, my brother"
}

{"description":"I know PapaSmooth as a giga chad in abstract family

This is a guy with endless passion for GREENCHAIN, he often shares really useful insights about Abstract on X like memes, nft, etc

Haven't had a chance to talk to him much yet but I believe if you're going deep into Abstract you should follow him. Keep up the great work my friend"}

{
  "description": "First time we knew each other though the Huddle, a bit later when i joined Abstract and found out Brian. He is leading Asia region in ecosystem. So warm welcome newbies not only via socials like X, tg, discord, also IRL events (so important). Brian is real legend, happy to support him in such on-chain journey"
}

{
  "description": "Never told with him directly, but what he is doing for a long time deserve huge shout-out. How he cares about his community, early supporters. Nothing more then just huge respect."
}

{
  "description": "I first knew him from what he built as the tool to help user manage and optimize bigcoin mining set-ups both facilities and miners.

As we met once again in onchain heroes discord where I feel like he's one of the most active guys in och community, I witnessed his 2nd large and solid build toward och ecosystem whether the real-time analytics, dragma leaderboard chart, or p2p marketplace to facilitate och players as a whole and even the season 2 summary 

more than enough to say he's a talented dev and he usually share his thought technically on new contracts from various projects which I found this really useful in many cases and appreciate him"
}

{
  "description": "My Giga Chad bro in Abstract, OG in Wolves. He always sharing Untamed Reports (pretty helpful) about eco and support others on-chain"
}

{
  "description": "Sinet is a great person I met on abstract. He's been committed and involved since the beginning. Always there to propagate the green chain. He makes quality and always useful threads on X. He's also a very good duper player. Sinet is a gigantic chad and it's completely deserved. I hope we go far together on abstract."
}

{
  "description": "I discovered Gucci on abstract and it was a great discovery. A happy person and always there to help you. He is an involved and committed person, when he loves something he does it fully. He became a content creator thanks to abstract and he is very talented. I wish you the best my brother and I hope that one day we can meet in real life. Love you Fratello."
}

{
  "description": "PapaSmooth's been in the Wolves community since day one and he's been one of my favorite members. Very involved, friendly, and happy to share alpha. An asset to any community"
}
